import ReactPlayer from "react-player"
import "./MusicPage.css"

function MusicPage() {
    return (
        <div className="music-page-main-wrapper">
            <h1>MUSIC PAGE naglowek plus wstep do pagu</h1>
            <h1>Live gigs</h1>
            <ReactPlayer className="hip-hop" url="https://www.mixcloud.com/krzysztof-richter/zooluft-exp4-vv-mix/"
           width="100%" height={180}
           />
            <h1>HIP-HOP & RAP</h1>
          <ReactPlayer className="hip-hop" url="https://www.mixcloud.com/krzysztof-richter/hip-hop-cut/"
           width="100%" height={180}
           />
         <h1>HOUSE & DaNce</h1>
          <ReactPlayer className="hip-hop" url="https://www.mixcloud.com/krzysztof-richter/hip-hop-cut/"
           width="100%" height={180}
           />
          <ReactPlayer className="hip-hop" url="https://www.mixcloud.com/krzysztof-richter/hip-hop-cut/"
           width="100%" height={180}
           />
        </div>
    )
}


export default MusicPage;
